import React from 'react';

const DrumPad = ({keyTrigger, onClick}) => {
    return (
        <button id={keyTrigger} className="drum-pad" onClick={() => onClick(keyTrigger)}>
        {keyTrigger}
        </button>
    )
}

export default DrumPad;
